import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import Building from "./building/building";
import axios from "axios";
const emptyclass = () => {
    const navigate = useNavigate();
    function emptyHandler() {
        navigate("/home/")
    }
    axios({
        method: "post",
        url: "/api/login",
        headers: {
            "Content-Type": "multipart/form-data",
            "traefik": "user",
        },
    }).then(res => {
        console.log(res);
        const stuname=res.data.data.user_info.name;
        const stuid=res.data.data.user_info.student_id;
        const stupro=res.data.data.user_info.profession_name;
        const stucla=res.data.data.user_info.class;
        const stuuni=res.data.data.user_info.unit_name;
        const stucid=res.data.data.user_info.cqupt_id;
        handleStuInfo(stuid, stuname,stupro,stucla,stuuni,stucid);
        navigate('/mine/')
    }, err => {
        console.log(err)
        alert("请输入正确的用户名和密码")
        setBgColor('rgba(183, 183, 183, 0.69)');
    });
    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            <div id="emptychoice"></div>
            <div id="classchoice">
                <div id="building">
                    <Building/>
                </div>
            </div>
        </div>)
}
export default emptyclass;
